import React from "react";
import axios from "axios";

export default function ShowList() {

    const [showListing, setShowListing] = ([]);

    axios.get("https://api.betaseries.com/shows/list", {
        params: {
            client_id: "22f661bdce5c",
        }
    }).then(res => {
        setShowListing(res.data.shows);
    }).catch(error => {
        console.log(error.response)
    })

    return (
        <div className="container mx-auto border text-white border-red-500">
            <div className="grid grid-cols-2">
                <div className="grid col-span-1">
                    <div className="border">Coucou</div>
                </div>
                <div className="grid col-span-2 grid-cols-2">
                    <div>Coucou</div>
                    <div>Coucou</div>
                </div>
            </div>
        </div>
    );
}
